props.description:
O sutiã possui bojo triangular sem aros, permitindo conforto e sensualidade;
Com lindo decote em renda, deixa um efeito natural;
Base estreita, laterais e elástico largos, garantindo praticidade;
Costas em microfibra, abotoadores com três regulagens;
Alças paralelas, fixas e ajustáveis, proporcionando uma sustentação perfeita;
Seu design moderno e alongado, é ideal para ser usado com roupas decotadas, oferecendo versatilidade;
